import React from 'react';
import Typography from "@material-ui/core/Typography";
import Toolbar from "@material-ui/core/Toolbar";
import AppBar from "@material-ui/core/AppBar";
import './Header.scss';
import {NavLink} from "react-router-dom";
import {appConstants} from "../constants/constant";
import Button from "@material-ui/core/Button/Button";
import {checkLogin} from "../actions/user.action";
import {useDispatch, useSelector} from "react-redux";

const Header = () => {
    const user = useSelector(({user}) => {
        return user;
    });


    const dispatch = useDispatch();
    // dispatch(checkLogin());
    const logout = () => {
        const logoutPromise = fetch('http://localhost:8089/logout', {credentials: 'include'})
            .then(res => res.json())
            //
            // .then(res => {
            //     console.log(res);
            //     res.success ?
            //         // check success is a function
            //         typeof success === 'function' && success() :
            //         typeof failure === 'function' && failure();
            //     return res;
            // })
            // .catch(err => {
            //     typeof failure === 'function' && failure(err);
            //     return err;
            // });
            .catch();
        dispatch({
            type: appConstants.LOGOUT,
            payload: logoutPromise
        });

        console.log('checkLogin from logout');
        dispatch(checkLogin());
    };


    return (
        <AppBar position="static" className="Header">
            <Toolbar>
                <Typography variant="h6" className="app-name">
                    MSI
                </Typography>
                <div className="nav-actions">
                    <NavLink to={appConstants.floorPlanRoute}>
                        <Button>Floor Plans</Button>
                    </NavLink>

                    <NavLink to={appConstants.locationsRoute}>
                        <Button>Locations</Button>
                    </NavLink>
                    <NavLink to={appConstants.quickLookRoute}>
                        <Button>QuickLook</Button>
                    </NavLink>
                    <NavLink to={appConstants.FAQRoute}>
                        <Button>FAQ</Button>
                    </NavLink>
                    <NavLink to={appConstants.loginRoute} style={{textDecoration: 'none'}}>
                        {
                            user ?
                                <Button onClick={logout} className="auth-action">Logout</Button> :
                                <Button className="auth-action">Login</Button>
                        }
                    </NavLink>
                </div>
            </Toolbar>
        </AppBar>
    );
};
export default Header;
